function ModalItem( props ) {
    const handeChange = (event) => {
        const value = event.target.thanh;
        console.log(value);
    }
    return (
      props.orderHeader &&
      props.orderHeader.map((item,index) => {
      return (
        <tr key={index} onClick={(event)=>handeChange(event)}>
           <td>{item.STT}</td>
           <td>{item.KhuVuc}</td>
           <td name="thanh">{item.MaDH}</td>
           <td>{item.MaKH}</td>
           <td>{item.TenKH}</td>
           <td>{item.TrangThai}</td>
        </tr>
      )
    })
   
  );
}

export default ModalItem;
